import { Fragment } from "react"

const BackDrop = ()=>{
    return <div className="backDrop"></div>
}

const Model = (props)=>{
    return <Fragment>
        <BackDrop/>
        <div className="modelContainer">
            {props.children}
        </div>
    </Fragment>
}

export default Model
